function Palindrome() {
  const a = 1;
  const b = 2;
  const c = 2;
  const d = 1;

  const test = () => {
    if (a == d && b == c) {
      <h1>true</h1>;
    }
    <h1>false</h1>;
  };
  return <h1>{test}</h1>;
}

export default Palindrome;
